section.article:
I Article 1 (1) tilføyes følgende etter bokstav (k):
► M2
spices originating in or consigned from Ethiopia;
groundnuts (peanuts) in shell and shelled, peanut butter, groundnuts (peanuts) otherwise prepared or preserved (feed and food) originating in or consigned from Argentina;
hazelnuts in shell and shelled, mixtures of nuts or dried fruits containing hazelnuts, hazelnut paste, hazelnuts prepared or preserved including mixtures, flour, meal and powder of hazelnuts, cut sliced and broken hazelnuts, and hazelnut oil originating in or consigned from Azerbaijan;
